  const test = () => {
    // fetch("http://localhost:5000/api/tasks")
    //   .then((res) => res.json())
    //   .then((data) => {
    //     console.log(data);
    //   });
    ApiService.getAllTasks();
  };

  useEffect(() => {
    test();
  }, []);

  return (
    <div>
      <table className="table">
        <thead>
          <tr>
            <th>Task Id</th>
            <th>Task Title</th>
            <th>Task Description</th>
            <th>Actions</th>
          </tr>
        </thead>
      </table>
    </div>
  );
};

export default Table;
